import logo from './logo.svg';
import './App.css';
// import the library
import { library } from '../node_modules/@fortawesome/fontawesome-svg-core'

// import your icons
import { faCode, faHighlighter } from '../node_modules/@fortawesome/free-solid-svg-icons';

library.add(
  faHighlighter
  // more icons go here
);

function App() {
  return (
    <div className="App">

      <div className="row">
        <div className="col-md-6"><i class="fas fa-code"></i>tghth</div>
      </div>
    </div>
  );
}

export default App;
